import HeaderBottom from "./HeaderBottom/HeaderBottom";
import CenterHeader from "./CenterHeader/CenterHeader";
import CenterCenter from "./CenterCenter/CenterCenter";
import CenterBottom from "./CenterBottom/CenterBottom";
import FooterHeader from "./FooterHeader/FooterHeader";
import Containers from "./Containers/Containers";
import {Route} from "react-router-dom";
import PizzaOrderContainer from "../PizzaOrder/PizzaOrderContainer";

const Profile = () => {
    return (
        <div>
            <HeaderBottom/>
            <CenterHeader/>
            <Containers/>
            <CenterCenter/>
            <CenterBottom/>
            <FooterHeader/>
            <Route path="/profile/pizza/:id" render={() => <PizzaOrderContainer
            />}/>
        </div>
    )
}
export default Profile
